import { THEMES } from "./themes";

export function renderTrybeCard(grade: number, theme=THEMES.default, options = {}) {    
    const title = "Meu perfil Ã© nota:";

    //unpack Theme options
    const {
        title_color,    
        icon_color,     
        text_good_color, 
        text_medium_color, 
        text_bad_color, 
        bg_color, 
        empty_color,
        fill_good_color,
        fill_medium_color,
        fill_bad_color,
        emoj_code_good,
        emoj_code_medium,
        emoj_code_bad
    } = theme;

    const iconSize = 90;
    const cardWidth = 630;
    const cardHeight = 170;
    const cardBorderRadius = 15;
    const progresseEmptyWidth = 445;
    const progressHeight = 20;
    const progressBorderRadius = 8;
    
    if (grade < 0)  grade = 0;
    else if (grade > 100)   grade = 100;
        
    const progresseFillWidth = ((progresseEmptyWidth * grade) / 100);

    return `
    <svg 
        xmlns="http://www.w3.org/2000/svg" 
        width="${cardWidth}" 
        height="${cardHeight}"
        viewBox="0 0 ${cardWidth} ${cardHeight}"
        role="img"
    >                
        <rect x="0.5" y="0.5"
        height="99%"
        width="99%"
        fill="#${bg_color}"
        rx="${cardBorderRadius}"/>  
        <g transform="translate(25, 35)">
            <g transform="translate(0, 0)">
                <text 
                    xmlns="http://www.w3.org/2000/svg" 
                    x="120" y="42"
                    class="header"                     
                    data-testid="header">                    
                    ${title}
                </text>
            </g>
        </g>  
        <g>
            <g>
            <rect 
                xmlns="http://www.w3.org/2000/svg" 
                mask="url(#rect-mask)" 
                data-testid="lang-progress" 
                x="144" y="105" 
                width="${progresseEmptyWidth}" 
                height="${progressHeight}" 
                fill="#${empty_color}"
                rx="${progressBorderRadius}"/>
            <rect 
                xmlns="http://www.w3.org/2000/svg" 
                mask="url(#rect-mask)" 
                data-testid="lang-progress" 
                x="144" y="105" 
                width="${progresseFillWidth}" 
                height="${progressHeight}" 
                fill="#${grade/10 >= 9? fill_good_color : (grade/10 >= 5? fill_medium_color : fill_bad_color) }"
                rx="${progressBorderRadius}"/>
            <text 
                xmlns="http://www.w3.org/2000/svg" 
                x="500" y="120"
                class="textPunctuation"                     
                data-testid="header">                    
                ${grade.toString().length == 1? '0'+(grade/10).toString() : (grade/10)}/10
            </text>
            <text 
                xmlns="http://www.w3.org/2000/svg" 
                x="550" y="133"
                class="emoj"                     
                data-testid="header">                    
                &#${grade/10 >= 9? emoj_code_good : (grade/10 >= 5? emoj_code_medium : emoj_code_bad) };
            </text>
            </g>
        </g>                
        <defs>
            <style 
                type="text/css"
                xmlns="http://www.w3.org/2000/svg">
                @font-face {
                    font-family: 'Epilogue';                    
                    font-weight: bold;
                    src: local('Epilogue'),
                    url(data:font/woff2;base64,) format('woff2');
                    unicode-range: U+0000-00FF, U+0131, U+0152-0153, U+02BB-02BC, U+02C6, U+02DA, U+02DC, U+2000-206F, U+2074, U+20AC, U+2122, U+2191, U+2193, U+2212, U+2215, U+FEFF, U+FFFD;
                }
                .header {                
                    font-family: 'Epilogue', sans-serif;                    
                    font-size: 50px;
                    fill: #${title_color};
                    animation: fadeInAnimation 0.8s ease-in-out forwards;
                }            
                .textPunctuation{
                    font-family: 'Epilogue', sans-serif;
                    font-weight: semi-bold;
                    font-size: 15px;
                    fill: #${grade/10 >= 9? text_good_color : (grade/10 >= 5? text_medium_color : text_bad_color) };
                    animation: fadeInAnimation 0.8s ease-in-out forwards;
                }
                .emoj{
                    font-size: 50px;
                }
            </style>
        </defs>
        <svg 
            width="${iconSize}" 
            height="${iconSize}" 
            viewBox="0 0 208 237" 
            fill="#${icon_color}"
            x="25" y="37"
            xmlns="http://www.w3.org/2000/svg">
            <path d="M145.25 124.34L185.82 195C186.749 196.736 188.138 198.181 189.835 199.178C191.533 200.175 193.472 200.684 195.44 200.65C196.941 200.681 198.433 200.411 199.828 199.857C201.223 199.303 202.494 198.476 203.565 197.425C204.637 196.373 205.487 195.118 206.066 193.733C206.646 192.348 206.943 190.861 206.94 189.36L207.15 48C207.216 45.4709 206.428 42.9933 204.912 40.9675C203.397 38.9416 201.243 37.4857 198.798 36.8349C196.353 36.1841 193.76 36.3764 191.438 37.3807C189.116 38.3851 187.2 40.1428 186 42.37L145.22 112.84C144.224 114.553 143.718 116.508 143.76 118.49C143.719 120.535 144.223 122.554 145.22 124.34" fill="#${icon_color}"/>
            <path d="M103.22 148.39L144 218.86C145.038 220.643 145.615 222.657 145.68 224.72C145.68 230.78 140.24 236.01 134.18 236.01C132.202 236.021 130.255 235.518 128.53 234.55L6.19998 163.65C4.48189 162.703 3.05052 161.311 2.05631 159.62C1.0621 157.929 0.541737 156.002 0.549959 154.04C0.520767 152.516 0.795068 151.002 1.35691 149.585C1.91874 148.168 2.75692 146.877 3.82254 145.787C4.88816 144.697 6.15995 143.83 7.56388 143.237C8.9678 142.643 10.4758 142.335 12 142.33L93.3499 142.74C95.3485 142.693 97.3217 143.195 99.0548 144.191C100.788 145.187 102.215 146.639 103.18 148.39" fill="#${icon_color}"/>
            <path d="M93.18 93.6H11.83C9.34092 93.5943 6.92303 92.7684 4.95065 91.25C2.97826 89.7316 1.56136 87.6055 0.919153 85.2007C0.276947 82.7958 0.445264 80.2463 1.3981 77.9468C2.35093 75.6472 4.03512 73.7259 6.19003 72.48L128.73 2.00001C130.511 0.965814 132.522 0.391832 134.58 0.329998C136.586 0.3173 138.56 0.842427 140.294 1.85072C142.029 2.85901 143.462 4.31365 144.444 6.06337C145.426 7.81309 145.921 9.79398 145.879 11.8C145.836 13.806 145.256 15.7639 144.2 17.47L103 88C102.016 89.7348 100.586 91.174 98.8568 92.1677C97.1278 93.1615 95.164 93.6733 93.17 93.65" fill="#${icon_color}"/>
        </svg>        
    </svg>
    `;
}